  return (
    <View gap={4} padding={4}>
      <View gap={3}>
        <ToggleButtonGroup
          value={tripType}
          onChange={({ value }) => {
            setTripType(value);
            if (!value.includes("return")) {
              setReturnDate(null);
            }
          }}
          selectionMode="single"
        >
          <ToggleButton value="oneway">One Way</ToggleButton>
          <ToggleButton value="return">Return</ToggleButton>
        </ToggleButtonGroup>

        <View direction="row" gap={2}>
          <View.Item grow>
            <Autocomplete
              placeholder="From"
              value={fromInputValue}
              onInput={(e) => setFromInputValue(e.value)}
              onItemSelect={({ value }) => {
                setFromAirport(value);
                setFromInputValue(value);
              }}
            >
              {filteredFromAirports.map((airport) => (
                <Autocomplete.Item
                  key={airport.code}
                  value={`${airport.code}: ${airport.name}`}
                >
                  {airport.code}: {airport.name}
                </Autocomplete.Item>
              ))}
            </Autocomplete>
          </View.Item>

          <View.Item grow>
            <Autocomplete
              placeholder="To"
              value={toInputValue}
              onInput={(e) => setToInputValue(e.value)}
              onItemSelect={({ value }) => {
                setToAirport(value);
                setToInputValue(value);
              }}
            >
              {filteredToAirports.map((airport) => (
                <Autocomplete.Item
                  key={airport.code}
                  value={`${airport.code}: ${airport.name}`}
                >
                  {airport.code}: {airport.name}
                </Autocomplete.Item>
              ))}
            </Autocomplete>
          </View.Item>
        </View>

        <View direction="row" gap={2}>
          <View.Item grow>
            <Popover>
              <Popover.Trigger>
                <Button fullWidth>
                  {departureDate ? formatDate(departureDate) : "Departure Date"}
                </Button>
              </Popover.Trigger>
              <Popover.Content>
                <Calendar
                  value={departureDate}
                  onChange={({ value }) => {
                    setDepartureDate(value);
                    if (
                      isReturnTrip &&
                      returnDate &&
                      value &&
                      value > returnDate
                    ) {
                      setReturnDate(null);
                    }
                  }}
                  min={today}
                />
              </Popover.Content>
            </Popover>
          </View.Item>

          {isReturnTrip && (
            <View.Item grow>
              <Popover>
                <Popover.Trigger>
                  <Button fullWidth>
                    {returnDate ? formatDate(returnDate) : "Return Date"}
                  </Button>
                </Popover.Trigger>
                <Popover.Content>
                  <Calendar
                    value={returnDate}
                    onChange={({ value }) => setReturnDate(value)}
                    min={departureDate || today}
                  />
                </Popover.Content>
              </Popover>
            </View.Item>
          )}
        </View>

        <Button onClick={onSubmit} fullWidth variant="solid" color="primary">
          Search Flights
        </Button>
      </View>
    </View>
  );
};

export default FlightBooking;

